import React from "react";
import { Routes, Route, useNavigate } from "react-router-dom";
import BlogFeeds from "./components/blog/BlogFeeds";
// import BlogDetails from "./components/blog/BlogDetails";
// import AboutMe from "./components/aboutMe/AboutMe";
// import HireMe from "./components/hireMe/HireMe";
import ThankYou from "./components/thankYou/ThankYou";
import NavBar from "./components/navBar/NavBar";
import { lazy, Suspense } from "react";
import { ErrorBoundary } from "react-error-boundary";

const HireMe = lazy(() => import("./components/hireMe/HireMe"));
const BlogDetails = lazy(() => import("./components/blog/BlogDetails"));
const AboutMe = lazy(() => import("./components/aboutMe/AboutMe"));

function App() {
  const navigate = useNavigate();

  return (
    <>
      <NavBar collapseOnSelect expand="false" />
      <Routes>
        <Route exact path="/" element={<BlogFeeds />} />
        <Route
          exact
          path="/:slug"
          element={
            <ErrorBoundary onReset={() => navigate("/")}>
              <Suspense>
                <BlogDetails />
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          path="/me"
          element={
            <ErrorBoundary onReset={() => navigate("/")}>
              <Suspense>
                <AboutMe />
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route
          exact
          path="/hire-me"
          element={
            <ErrorBoundary onReset={() => navigate("/")}>
              <Suspense>
                <HireMe />
              </Suspense>
            </ErrorBoundary>
          }
        />
        <Route exact path="/thank-you" element={<ThankYou />} />
      </Routes>
    </>
  );
}

export default App;
